      "Comment": "What is a ’Currency Forward’  A binding contract in the foreign exchange market that locks in the exchange rate for the purchase or sale of a currency on a future date. A currency forward is essentially a hedging tool that does not involve any upfront payment. The other major benefit of a currency forward is that it can be tailored to a particular amount and delivery period, unlike standardized currency futures. Currency forward settlement can either be on a cash or a delivery basis, provided that the option is mutually acceptable and has been specified beforehand in the contract. Currency forwards are over-the-counter (OTC) instruments, as they do not trade on a centralized exchange. Also known as an “outright forward.”  BREAKING DOWN ’Currency Forward’  Unlike other hedging mechanisms such as currency futures and options contracts – which require an upfront payment for margin requirements and premium payments, respectively – currency forwards typically do not require an upfront payment when used by large corporations and banks. However, a currency forward has little flexibility and represents a binding obligation, which means that the contract buyer or seller cannot walk away if the “locked in” rate eventually proves to be adverse. Therefore, to compensate for the risk of non-delivery or non-settlement, financial institutions that deal in currency forwards may require a deposit from retail investors or smaller firms with whom they do not have a business relationship.  The mechanism for determining a currency forward rate is straightforward, and depends on interest rate differentials for the currency pair (assuming both currencies are freely traded on the forex market). For example, assume a current spot rate for the Canadian dollar of US$1 = C$1.0500, a one-year interest rate for Canadian dollars of 3%, and one-year interest rate for US dollars of 1.5%.  After one year, based on interest rate parity, US$1 plus interest at 1.5% would be equivalent to C$1.0500 plus interest at 3%.  Or, US$1 (1 + 0.015) = C$1.0500 x (1 + 0.03).  So US$1.015 = C$1.0815, or US$1 = C$1.0655.  The one-year forward rate in this instance is thus US$ = C$1.0655. Note that because the Canadian dollar has a higher interest rate than the US dollar, it trades at a forward discount to the greenback. As well, the actual spot rate of the Canadian dollar one year from now has no correlation on the one-year forward rate at present. The currency forward rate is merely based on interest rate differentials, and does not incorporate investors’ expectations of where the actual exchange rate may be in the future.  How does a currency forward work as a hedging mechanism? Assume a Canadian export company is selling US$1 million worth of goods to a U.S. company and expects to receive the export proceeds a year from now. The exporter is concerned that the Canadian dollar may have strengthened from its current rate (of 1.0500) a year from now, which means that it would receive fewer Canadian dollars per US dollar. The Canadian exporter therefore enters into a forward contract to sell $1 million a year from now at the forward rate of US$1 = C$1.0655.  If a year from now, the spot rate is US$1 = C$1.0300 – which means that the C$ has appreciated as the exporter had anticipated – by locking in the forward rate, the exporter has benefited to the tune of C$35,500 (by selling the US$1 million at C$1.0655, rather than at the spot rate of C$1.0300). On the other hand, if the spot rate a year from now is C$1.0800 (i.e. the C$ weakened contrary to the exporter’s expectations), the exporter has a notional loss of C$14,500.  Read more: Currency Forward http:\/\/www.investopedia.com\/terms\/c\/currencyforward.asp#ixzz4rLJaXxVG  ",
      "CommentNL": "Wat is een ’valutatermijn’  Een bindend contract op de valutamarkt dat de wisselkoers vastzet voor de aan- of verkoop van een valuta op een toekomstige datum. Een valutatermijn is in wezen een afdekkingsinstrument waarvoor geen vooruitbetaling nodig is. Het andere grote voordeel van een valutatermijn is dat deze kan worden aangepast aan een bepaald bedrag en een bepaalde leveringsperiode, in tegenstelling tot gestandaardiseerde valutafutures. Valutatermijnafwikkeling kan plaatsvinden op basis van contante betaling of levering, op voorwaarde dat de optie wederzijds aanvaardbaar is en van tevoren in het contract is gespecificeerd. Valutatermijncontracten zijn over-the-counter (OTC) -instrumenten, aangezien ze niet op een gecentraliseerde beurs worden verhandeld. Ook wel bekend als een ’regelrechte aanvaller’.  UITBREIDING ’Valutatermijn’  In tegenstelling tot andere afdekkingsmechanismen zoals valutafutures en optiecontracten - die een vooruitbetaling vereisen voor respectievelijk margevereisten en premiebetalingen - vereisen valutatermijncontracten doorgaans geen vooruitbetaling wanneer deze worden gebruikt door grote ondernemingen en banken. Een valutatermijn heeft echter weinig flexibiliteit en vertegenwoordigt een bindende verplichting, wat betekent dat de contractkoper of -verkoper niet weg kan lopen als de ’lock-in’ -koers uiteindelijk nadelig blijkt te zijn. Om het risico van niet-levering of niet-afwikkeling te compenseren, kunnen financiële instellingen die valutatermijncontracten verhandelen, daarom een ??deposito eisen van kleine beleggers of kleinere bedrijven met wie zij geen zakelijke relatie hebben.  Het mechanisme voor het bepalen van een valutatermijnkoers is eenvoudig en hangt af van de renteverschillen voor het valutapaar (ervan uitgaande dat beide valuta’s vrij verhandeld worden op de forexmarkt). Neem bijvoorbeeld een huidige contante koers voor de Canadese dollar van US $ 1 = C $ 1,0500, een eenjarige rente voor Canadese dollars van 3% en een eenjarige rente voor Amerikaanse dollars van 1,5%.  Na één jaar, op basis van rentepariteit, zou $ 1 plus rente van 1,5% gelijk zijn aan C $ 1,0500 plus rente van 3%.  Of US $ 1 (1 + 0,015) = C $ 1,0500 x (1 + 0,03).  Dus US $ 1,015 = C $ 1,0815, of US $ 1 = C $ 1,0655.  De termijnrente voor één jaar is in dit geval dus US $ = C $ 1,0655. Merk op dat omdat de Canadese dollar een hogere rente heeft dan de Amerikaanse dollar, deze wordt verhandeld met een korting op de termijn ten opzichte van de dollar. Bovendien heeft de actuele contante koers van de Canadese dollar over een jaar geen correlatie met de termijnkoers over een jaar op dit moment. De valutatermijnkoers is louter gebaseerd op renteverschillen en houdt geen rekening met de verwachtingen van beleggers over waar de werkelijke wisselkoers in de toekomst zou kunnen zijn.  Hoe werkt een valutatermijncontract als afdekkingsmechanisme? Stel dat een Canadees exportbedrijf goederen ter waarde van $ 1 miljoen aan een Amerikaans bedrijf verkoopt en verwacht de exportopbrengst over een jaar te ontvangen. De exporteur is bezorgd dat de Canadese dollar over een jaar mogelijk gestegen is ten opzichte van zijn huidige koers (van 1,0500), wat betekent dat hij minder Canadese dollars per Amerikaanse dollar zou ontvangen. De Canadese exporteur sluit daarom een ??termijncontract af om vanaf nu $ 1 miljoen per jaar te verkopen tegen de termijnkoers van US $ 1 = C $ 1,0655.  Als over een jaar de contante koers US $ 1 = C $ 1,0300 is - wat betekent dat de C $ is gestegen zoals de exporteur had verwacht - door de forward-koers vast te zetten, heeft de exporteur geprofiteerd van C $ 35.500 (door te verkopen de US $ 1 miljoen tegen C $ 1,0655, in plaats van tegen de contante koers van C $ 1,0300). Aan de andere kant, als de spotkoers over een jaar C $ 1,0800 is (d.w.z. de C $ verzwakt in tegenstelling tot de verwachtingen van de exporteur), heeft de exporteur een fictief verlies van C $ 14.500.  Lees meer: ??Currency Forward http:\/\/www.investopedia.com\/terms\/c\/currencyforward.asp#ixzz4rLJaXxVG Volg ons: Investopedia op Facebook",
