      "Vervallen": "0",
      "Comment": "The Standard Industrial Classification (SBI) designed by Statistics Netherlands The SBI is a hierarchical classification of economic activities that Statistics Netherlands uses to classify business units according to their main activity. The SBI has 5 roll-up levels, of which the lowest available level (4 or 5) is assigned to the Organization.  Based on an EU regulation, CBS is obliged to base the national activity classification SBI on the four digits of the NACE. The fifth digit is an additional breakdown for national use.",
      "CommentNL": "De Standaard Bedrijfsindeling (SBI) ontworpen door het CBS De SBI is een hiërarchische indeling van economische activiteiten die het CBS onder meer gebruikt om bedrijfseenheden in te delen naar hun hoofdactiviteit.  De SBI kent 5 oprol levels, waarvan het laagst beschikbar level (4 of 5) aan de Organisatie wordt toegewezen.  Op basis van een EU-verordening is het CBS verplicht de nationale activiteitenindeling SBI te baseren op de vier digits van de NACE. De vijfde digit is een extra uitsplitsing voor nationaal gebruik.",
