      "Code": "client kredietstelsel",
      "Parent Entity#Name": "party groups",
      "Parent Entity#Code": "party groepen",
      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "A Credit Group is a combination of two or more Organizations (business entities (corporations) in Matrix) that have entered into a credit agreement with thefirm under joint and several liability’. In Matrix, a credit system is established by linking a Group Leader and one or more Group Members at entity level (a ’corporation’).  N.B. 1 Setting up a credit system does not imply balance and \/ or interest compensation. These facilities have been discontinued at the beginning of October 2018.  N.B. 2 A corporation can have one or more Portfolios. For reporting purposes, all Portfolios existing within a ’corporation’ are included in the credit system.  N.B. 3 In addition to the Credit System, Matrix also records whether there is a ’Group of Connected Clients’, both where it concerns a legal relationship (based on shareholding and \/ or control) and an economic dependence. These groups are called in Matrix ’Legal group’ and ’Risk group’ respectively. One entity can be ’Group leader’, the other entities are ’Group member’.  Setting up an AI system is not permitted for private customers. In general, persons who enter into a credit agreement with thefirm under joint and several liability will be administered as an ’and \/ or’ relationship or as an ’and \/ and’ relationship.",
      "CommentNL": "‘Een Kredietstelsel is een combinatie van twee of meer Organisaties (zakelijke entiteiten (corporates) in Matrix), die onder wederzijdse hoofdelijke aansprakelijkheid een kredietovereenkomst zijn aangegaan met thefirm’. In Matrix wordt een kredietstelsel vastgelegd door op entiteits-niveau (een ‘corporate’) een Groepsleider en één of meer Groepsleden aan elkaar te koppelen.  N.B. 1 Het inrichten van een kredietstelsel betekent niet dat er sprake is van saldo- en \/of rentecompensatie. Deze faciliteiten zijn per begin oktober 2018 afgeschaft.  N.B. 2 Een ‘corporation kan één of meer Portfolio’s hebben. Voor rapportagedoeleinden worden alle Portfolio’s die binnen een ‘corporation’ bestaan, meegenomen in het kredietstelsel.  N.B. 3 Naast het Kredietstelsel wordt in Matrix ook vastgelegd of er sprake is van een ‘Group of Connected Clients’, zowel waar het een juridische relatie betreft (o.b.v. aandelenbelang en\/of zeggenschap) als een economische afhankelijkheid. Deze groepen heten in Matrix ‘Juridische groep’ respectievelijk ‘Risico groep’. Eén entiteit kan ‘Group leader’ zijn, de overige entiteiten zijn ‘Groepslid’.   Voor particuliere klanten is inrichting van een KI-stelsel niet toegestaan. Over het algemeen zullen personen die onder wederzijdse hoofdelijke aansprakelijkheid een kredietovereenkomst met thefirm aangaan geadministreerd worden als ‘en\/of’-relatie of als ‘en\/en’-relatie. ",
