      "Name": "guarantee issued",
      "Code": "garantie uitgegeven",
      "Parent Entity#Name": "creditproduct classification",
      "Parent Entity#Code": "kredietproduct classificatie",
      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "A The Firm guaranty is a bankguaranty that The Firm issued for third parties to the client. A bankguaranty is a contract whereby a bank unconditionally guaranties to pay an amount to the beneficiary, if he claims. For example, if two parties deal with each other and there is a period between paying the invoice amount and delivering the goods, the supplier may require a bankguaranty. The client pays a fee to the bank for this bank guarantee. It is in fact a security statement. In some cases, the government also accepts collateral by means of a bank guaranty, for example in case of collateral for a preservative assessment. Bankguaranties cost money. ",
      "CommentNL": "Een The Firm-garantie is een bankgarantie die The Firm ten behoeve van derden aan de klant heeft afgegeven. Een bankgarantie is een contract waarbij een bank zich onvoorwaardelijk garandeert een bedrag aan de begunstigde te betalen, als hij een claim indient. Als twee partijen bijvoorbeeld met elkaar zaken doen en er zit een periode tussen het betalen van het factuurbedrag en het leveren van de goederen, kan de leverancier een bankgarantie eisen. Voor deze bankgarantie betaalt de klant een vergoeding aan de bank. Het is in feite een veiligheidsverklaring. In sommige gevallen accepteert de overheid ook onderpand door middel van een bankgarantie, bijvoorbeeld in het geval van onderpand voor een conservatieve toets. Bankgaranties kosten geld. ",
      "Creator": "unlopo",
      "Creation Date": "Wednesday 6 January 2016 15:05:00",
