      "Code": "garantie ontvangen",
      "Parent Entity#Name": "collateral",
      "Parent Entity#Code": "zekerheid",
      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "A bankguarantee that The Firm received from a client or guarantor. A declaration of a guarantor ( A) guaranteed (B) obligations on the recipient ( s) will fulfill. Usually this involves paying a sum of money if B fails .  A guaranty is only legal value as A to a particular date irrevocable obligation to pay the guaranty amount on the first written demand . For example, the bank gives off a bank guaranty for a mortgagor and imagines thus ensures that the buyer of a house for example, are able to meet financial obligations. The buyer pays a fee. ",
      "CommentNL": "Een verklaring van een garantsteller (A) gegarandeerde (B) verplichtingen van de ontvanger (s) zal voldoen. Meestal gaat het om het betalen van een geldbedrag als B faalt. Een garantie heeft alleen juridische waarde als A tot een bepaalde datum onherroepelijke verplichting om het garantiebedrag op de eerste schriftelijke aanmaning te betalen. De bank geeft bijvoorbeeld een bankgarantie af voor een hypotheekgever en stelt zich daarmee voor dat de koper van bijvoorbeeld een huis aan financiële verplichtingen kan voldoen. De koper betaalt een vergoeding.",
