      "Comment": "A third party (person or organization) that promises to pay for a bond, loan, or other liability in the event of default. While many guarantees apply to debt instruments, they can also be used for daily expenses. For example, a parent can guarantee an adult child.",
      "CommentNL": "Een derde partij (persoon of organisatie) die belooft te betalen voor een obligatie, lening of andere aansprakelijkheid in geval van wanbetaling. Hoewel veel garanties van toepassing zijn op schuldinstrumenten, kunnen ze ook worden gebruikt voor dagelijkse uitgaven. Een ouder kan bijvoorbeeld een volwassen kind garanderen.",
