      "Parent Entity#Code": "",
      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "With the help of a hedge, a position risk, as a result of falling \/ rising interest \/ exchange rates, is hedged with a bond instrument. A hedge is an exchange of risks to hedge risk, where part of the risk can be found on the stock exchange in the form of a bond that rises or falls, but the hedge itself is indeed not. A hedge consists of OTC treasury deals.  A hedge can possibly include several instruments at the same time: - macro hedge (hedging interest rate risk of several pieces at once with a counterpart) - micro hedge, is a 1 on 1 hedge. So only the interest rate risk on the NL bond is hedged with the hedge.",
      "CommentNL": "Met behulp van een hedge wordt een positie risico, als gevolg van dalende\/stijgende rente\/valutakoersen, afgedekt met een obligatie instrument. Een Hedge is een uitwisseling van risico’s om risico af te dekken, waarbij deel van het risico op de beurs te vinden is in de vorm van een obligatie die meestijgt of daalt, maar de hedge zelf inderdaad niet,  Een Hedge bestaat uit OTC deals van treasury.   Eventueel kan een Hedge meerdere instrumenten tegelijk omvatten:  - macro hedge (afdekken renterisico van meerdere stukken ineens met een tegenhanger)  - micro hedge, is een 1 op 1 afdekking. Dus alleen renterisico obligatie NL wordt met de hedge afgedekt.",
