      "Parent Entity#Code": "instrument",
      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "The term investment strategy refers to a set of principles designed to help an individual investor achieve their financial and investment goals. This plan is what guides an investor’s decisions based on goals, risk tolerance, and future needs for capital.1 They can vary from conservative (where they follow a low-risk strategy where the focus is on wealth protection) while others are highly aggressive (seeking rapid growth by focusing on capital appreciation). Investors can use their strategies to formulate their own portfolios or do so through a financial professional. Strategies aren’t static, which means they need to be reviewed periodically as circumstances change. Source: Investopedia",
      "CommentNL": "De term investeringsstrategie verwijst naar een reeks principes die zijn ontworpen om een individuele belegger te helpen zijn financiële en investeringsdoelen te bereiken. Dit plan is de leidraad voor de beslissingen van een belegger op basis van doelen, risicotolerantie en toekomstige kapitaalbehoeften.1 Ze kunnen variëren van conservatief (waar ze een strategie met laag risico volgen waarbij de nadruk ligt op vermogensbescherming), terwijl andere zeer agressief zijn ( streven naar snelle groei door te focussen op vermogensgroei). Beleggers kunnen hun strategieën gebruiken om hun eigen portefeuilles te formuleren of dit doen via een financiële professional. Strategieën zijn niet statisch, wat betekent dat ze periodiek moeten worden herzien als de omstandigheden veranderen. Bron: Investopedia",
