      "Comment": "The executor of a will is someone who takes care of the personal and financial business of the deceased.",
      "CommentNL": "Een formele relatie die 2 personen met elkaar hebben. Een executeur (in Nederland voorheen executeur-testamentair, in België testamentuitvoerder) is degene die het testament van een erflater ten uitvoer brengt, nadat deze is overleden.  De executeur kan een notaris zijn, maar ook een andere door de overledene daartoe aangewezen persoon. De executeur is degene die namens de erfgenamen de nalatenschap beheert, schulden betaalt en belastingaangiften indient. Verkoop van goederen is alleen mogelijk met medewerking van de erfgenamen of als verkoop nodig is om schulden te betalen. Als het de bedoeling is dat de executeur zaken kan verkopen zonder medewerking van de erfgenamen (bijvoorbeeld de woning), dan is het nodig dat de executeur in het testament ook tot een zogenaamde afwikkelingsbewindvoerder wordt benoemd.   DQ-regel: Alleen overlden personen mogen een executeur testamentair hebben",
