      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "A payment account is a current account with The Firm, through which the customer has access to the giro payment system. Payments can be made in various ways with the money in a checking account. For example, in a store with a debit card or by transferring money to another current account.",
      "CommentNL": "Een betaal rekening is een rekening courant bij The Firm, waarmee de klant toegang heeft tot het girale betalingsverkeer.  Met het geld op een betaalrekening kan op verschillende manieren een betaling worden uitgevoerd. Bijvoorbeeld in een winkel met een betaalpas of door geld over te maken naar een andere betaalrekening. ",
