      "Code": "effecten boeking",
      "Parent Entity#Name": "",
      "Parent Entity#Code": "",
      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "A securies booking describes the characteristics of a posted transaction which resulted in updating the position of a securities portfolio.  Note: Formerly, the Securities Booking entity was aggregated at the end of the day. MiFid’s Requirement is that Securities Bookings are reported on the smallest sub-level. Entity Securities Booking now describes the Securities Booking details of the lowest (most detailed) granularity.  A securies booking describes the characteristics of the sale or sale of instruments and which mutates the position of an instrument of one securities portfolio. There can be a distinction in: - Securities booking : Aggregated to Customer, Instrument, Effective Deposit Per Day - Intraday Securities Booking:  For example: Customer orders for 100 shares ABN  Intraday Securities Bookings (3x): - 30 pieces via AEX at a price of 10.10 and value € 15.00 - 20 pieces via Broker with a price of 11.00 and value € 14.75 - 50 pieces via AEX at a price of 16.45 and value € 25.25  Securities Booklet (aggregated): - 100 pieces with a closing price of 12.00 and a value of € 45.50 ",
      "CommentNL": "",
      "Creator": "unlopo",
      "Creation Date": "Tuesday 11 July 2017 16:24:04",
      "Modifier": "unlopo",
      "Modification Date": "Wednesday 30 March 2022 12:42:10",
