      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "A Roadshow, Marketing, Visit or Event organized by Kempen & Co  Campaigns are marketing activities (inbound or outbound) whose purpose it is to build interest and awareness around a company’s products, services and brand. Outbound campaign examples can include email blasts to introduce a new product, print advertisements, cold calling, or company events; inbound campaign examples include web-to-lead forms to collects names of people who want to learn more about a product, search engine optimization (SEO), or social media.",
      "CommentNL": "A Roadshow, Marketing, Visit or Event organized by Kempen & Co  Campagnes zijn marketingactiviteiten (inkomend of uitgaand) die tot doel hebben interesse en bekendheid op te bouwen rond de producten, diensten en het merk van een bedrijf. Voorbeelden van uitgaande campagnes zijn onder meer e-mailexplosies om een nieuw product te introduceren, gedrukte advertenties, ongevraagd bellen of bedrijfsevenementen; Voorbeelden van inkomende campagnes zijn web-to-lead-formulieren om namen te verzamelen van mensen die meer willen weten over een product, zoekmachineoptimalisatie (SEO) of sociale media.",
