      "Vervallen": "0",
      "Comment": "An order consists of instructions to a broker or brokerage firm to purchase or sell a security on an investor’s behalf. An order is the fundamental trading unit of a securities market. Orders are typically placed over the phone or online through a trading platform, although orders may increasingly be placed through automated trading systems and algorithms. Once an order is placed, it follows a process of order execution.",
