      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "A formal relationship between a client and another party. A chairperson or chairwoman (also called preses, rector or president) is the leader of an organization, ranging from associations and foundations to political groups, committees, international organizations and even states. The chairman leads the day-to-day management of the organisation, which generally consists of at least a chairman, a secretary and a treasurer. He also leads other meetings, such as plenary sessions.  DQ rule: Only certain legal forms (T.b.d.) may have the role of chairman",
      "CommentNL": "Een formele relatie tussen een client en een andere partij. Een voorzitter of voorzitster (ook wel preses, rector of president) is de leider van een organisatie, variërend van verenigingen en stichtingen tot fracties, commissies, internationale organisaties en zelfs staten.  De voorzitter leidt het dagelijks bestuur van de organisatie, dat in het algemeen ten minste bestaat uit een voorzitter, een secretaris en een penningmeester. Hij leidt ook andere vergaderingen, zoals plenaire vergaderingen.   DQ-regel: Alleen bepaalde rechtsvormen (T.b.d.) mogen de rol voorzitter hebben",
      "Creator": "unlopo",
