      "Comment": "The person or organization who has entered or intents to enter a clientrelation with The Firm or who has a transaction effected. Customer lifectycle management focused on the entire chain of client transactions, and designed to produce easily-digestible results. Client Lifecycle Management is an analytical process for managing client lifecycles to encourage retention and maximise profitability.  Lifecycle lifecycle: - lead - prospect - client - former client  Synonym: account  Business rules: - one client has passed the cdd process - one client can be either a person or an organization - one client has one or more roles in a clientportfolio - one client has a registered address - one client has a postal address - one client can be the leader of a clientgroup - one client can have one or more relationship with mulitple parties (not necessarily clients) - one clientportfolio is connected to at least one client",
