      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "When a ’debtor’ (debtor) ends up in a ’forbearnce’ process, the debtor can be given more time and\/or space to pay or. collecting the debt. The current financial situation and the possibility of embarking on a ’change’ process in the short term in order to still meet the payment obligations are then examined. This code indicates how a ’debtor’ (debtor) is given the opportunity to still meet his payment obligations. The following codes are currently used by Abacus \/ DaVinci (BearingPoint):  0 irrelevant 1 instruments with changes to their terms and conditions 2 refinancing",
      "CommentNL": "Wanneer een ’debtor’ (schuldenaar) in een ’forbearnce’ traject terecht komt kan de schuldenaar meer tijd en \/ of ruimte krijgen voor het voldoen cq. invorderen van de schuld. Er wordt dan gekeken naar de huidige financiële situatie en naar een mogelijkheid om korte termijn een ’verander’ traject in te gaan om als nog aan de betaalverplichtingen te voldoen. Deze code geeft aan op welke manier een ’debtor’ (schuldenaar) de mogelijkheid krijgt om alsnog aan zijn betaalverplichtingen te voldoen. De volgende codes worden momenteel door Abacus \/ DaVinci (BearingPoint) gehanteerd:  0 irrelevant 1 instrumenten met wijzigingen in hun algemene voorwaarden 2 herfinanciering",
