      "Vervallen": "0",
      "Comment": "Client Portfolio is the unique connection of one or more product owners and the products they own. In addition to product owners other authorized persons may also have a role in a portfolio. Examples are authorized representative and power of attornaty. An important feature is the ascription portfolio. are derived from the main product container Other features, such as address, peergroup and label.  ’Relation’ is a synonym of ’Client portfolio’, which is used in the thefirm legacy systems (CICS \/ Mainframe).  Business rules: - one clientportfolio has one connected main owner  - one clientportfolio has zero or more  connected co-owners - one clientportfolio has zero or more  connected authorized persons (power of attornies) - one clientportfolio has zero or more  connected dealing attornies - one clientportfolio is connected to one or more active products - one business clientportfolio has one client (organization) connected - one private clientportfolio has one or more clients (persons) connected ",
      "CommentNL": "Client Portfolio is de unieke verbinding van een of meer producthouders en de producten die ze bezitten. Naast producthouders kunnen ook andere gemachtigde personen een rol in een Client portfolio hebben.  Voorbeelden zijn beschikkingsbevoegde en gemachtige. Deze bevoegdheden gelden dan voor alle aan het Client portfolio gekoppelde producten.  Een belangrijk kenmerk van een Client Portfolio is de tenaamstelling.  Overige persoonskenmerken, zoals adres, doelgroep en label worden afgeleid van de Hoofdhouder.  In de thefirm legacy systemen (CICS\/Mainframe) wordt het begrip ’Relatie’ gebruikt als synoniem voor ’Client Portfolio’. ",
