      "Comment": "Depending on the client group (Asset clients, Business Professional, Healthcare, non-target group), a customer is served by an employee or by a Team. Non \/ target clients are served by a group of employees.  Several employees \/ team can be assigned to a Customer who are responsible for the operation. A client is always assigned a relationship manager. The other types are optional  Synonym AM : Account team",
