      "Code": "forbearance bbcode",
      "Parent Entity#Name": "",
      "Parent Entity#Code": "",
      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "When a ’debtor’ (debtor) ends up in a ’forbearnce’ process, the debtor can be given more time and\/or space to pay or. collecting the debt. The current financial situation and the possibility of embarking on a ’change’ process in the short term in order to still meet the payment obligations are then examined. This code indicates how a ’debtor’ (debtor) is given the opportunity to still meet his payment obligations and are in accordance with the delivery from Special Management. The following codes are currently used by the Special Management Tool:  1 Repayments\/ reductions have been (temporarily) increased 2 (Temporary) increase of the credit limit 3 Interest has been (temporarily) reduced or financing has been (temporarily) made interest-free 4. (Conditional and\/or partial) waiver",
      "CommentNL": "Wanneer een ’debtor’ (schuldenaar) in een ’forbearnce’ traject terecht komt kan de schuldenaar meer tijd en \/ of ruimte krijgen voor het voldoen cq. invorderen van de schuld. Er wordt dan gekeken naar de huidige financiële situatie en naar een mogelijkheid om korte termijn een ’verander’ traject in te gaan om als nog aan de betaalverplichtingen te voldoen. Deze code geeft aan op welke manier een ’debtor’ (schuldenaar) de mogelijkheid krijgt om alsnog aan zijn betaalverplichtingen te voldoen en zijn conform de aanlevering vanuit Bijzonder Beheer. De volgende codes worden momenteel door de Bijzonder Beheer Tool gehanteerd:  1 Aflossingen\/ reducties zijn (tijdelijk) verhoogd  2 (Tijdelijke) verhoging van de kredietlimiet 3 Rente is (tijdelijk) verlaagd of financiering is (tijdelijk) rentevrij gemaakt 4. (Voorwaardelijke en\/of gedeeltelijke) kwijtschelding",
