      "Comment": "Contractual agreements on the guarantees that can be used by the bank in the event that a debtor fails to meet his obligations, such as non-repayment of his repayment. There are different types of collateral, eg: real estate, bank guaranties, pledged securities portfolios, pledged saving deposits, etc. ",
      "CommentNL": "Contractuele afspraken over de waarborgen die door de bank kunnen worden gebruikt in het geval dat een debiteur zijn verplichtingen niet nakomt, zoals bijvoorbeeld het niet terugbetalen van zijn aflossing. Er zijn verschillende vormen van zekerheden. zoals: onroerend goed, ban garanties, verpande effecten, verpand creditgeld, etc.: ",
