      "Comment": "Describes the value range of portfolio roles. When a party (person or organization) has authority over a portfolio, we speak of a customer. When linking a party to a portfolio, the role that this party has within the portfolio must be specified: - head holder - co-holder - authorized person - decision maker - usufructuary (RDM)  Look out; The above roles are administrative records in matrix. The actual authority for an account is recorded in the product administrations (Bankview for savings\/credits, for eXuimius for securities and Fidor for payments).",
      "CommentNL": "Beschrijft het waardenbereik van portfoliorollen. Wanneer een party (persoon of organisatie) bevoegdheden heeft op een portfolio dan spreken we van een klant. Bij het koppelen van een party aan een portfolio moet de rol worden opgegeven die deeze party heeft binnen het portfolio: - hoofdhouder - medehoudeer - gemachtigde - beschikkingsbevoegde - vruchtgebruiker (RDM)   Let op; bovenstaande rollen zijn administratieve vastleggingen in matrix. De daadwerkelijke bevoegdheid oip een rekening wordt vastgelegd in de productadministraties (Bankview voor sparen \/kredieten, voor eXuimius voor effecten en Fidor voor betalen).",
