      "Comment": "The 9 grid model is used to estimate the value that an Employee can have for a department or company. Estimation takes place on the basis of the performance axis and the potential was. By determining for an employee both what the potential is and what the current performance is, you arrive at one of the 9 boxes in the 9-grid.  9-Grid assessment of an Employee (potential - potential assessment)   A - Under performer met senior potentieel   B - Solid performer met senior potentieel   C - High performer met senior potentieel   D - Under performer met potentieel   E - Solid performer met potentieel   F - High performer met potentieel   G - Under performer   H - Solid performer   I - Continual high performer",
      "CommentNL": "Met het 9 grid model wordt de waarde ingeschat die een Medewerker voor een afdeling of bedrijf kan hebben.  Inschatting vind plaats op basis van de performance as en de potentieel was.  Door voor een werknemer zowel te bepalen wat het potentieel is en wat de huidige performance is komt u uit op een van de 9 vakken in de 9-grid.  9-Grid beoordeling van een Medewerker (potentie - potentieel beoordeling)   A - Under performer met senior potentieel   B - Solid performer met senior potentieel   C - High performer met senior potentieel   D - Under performer met potentieel   E - Solid performer met potentieel   F - High performer met potentieel   G - Under performer   H - Solid performer   I - Continual high performer",
