      "CommentNL": "Stelsel van verbonden cliënten met een juridische of risico verbondenheid.  Juridische verbondenheid Twee of meer natuurlijke of rechtspersonen die, behoudens bewijs van het tegendeel, uit een oogpunt van risico één geheel vormen omdat een van hen rechtstreeks of onrechtstreeks zeggenschap heeft over de andere persoon of personen;  Risico verbondenheid Twee of meer natuurlijke of rechtspersonen tussen wie geen zeggenschapsband als beschreven in punt a) bestaat, maar die uit een oogpunt van risico als één geheel moeten worden beschouwd omdat zij zodanig onderling verbonden zijn dat, indien een van hen financiële problemen zou ondervinden, en met name financierings- of betalingsmoeilijkheden, de andere of alle anderen waarschijnlijk ook in financierings- of betalingsmoeilijkheden zouden komen. ",
