      "Comment": "What is a ’Currency Option’ A currency option is a contract that grants the buyer the right, but not the obligation, to buy or sell a specified currency at a specified exchange rate on or before a specified date. For this right, a premium is paid to the seller, the amount of which varies depending on the number of contracts if the option is bought on an exchange, or on the nominal amount of the option if it is done on the over-the-counter market. Currency options are one of the most common ways for corporations, individuals or financial institutions to hedge against adverse movements in exchange rates.   BREAKING DOWN ’Currency Option’ Investors can hedge against foreign currency risk by purchasing a currency put or call. Buying a put gives the holder the right, but not the obligation, to sell a currency at a stipulated rate by a given date; a call is the right to buy the currency. An investor who does not have an underlying exposure can take a speculative position in a currency by buying or selling a put or call. A person or institution that sells a put then has the obligation to buy the currency, while the seller of a call has the obligation to buy it.  Basics Options pricing has several components. The strike is the rate at which the owner of the option is able to buy the currency, if the investor is long a call, or sell it, if the investor is long a put. At the expiration date of the option, which is sometimes referred to as the maturity date, the strike price is compared to the then-current spot rate. Depending on the type of the option and where the spot rate is trading, in relation to the strike, the option is exercised or expires worthless. If the option expires in the money, the currency option is cash settled. If the option expires out of the money, it expires worthless.  Example Assume an investor is bullish on the euro and believes it will increase against the U.S. dollar. Therefore, the investor purchases a currency call option on the euro with a strike price of $115, since currency prices are quoted as 100 times the exchange rate. When the investor purchases the contract, the spot rate of the euro is equivalent to $110. Assume the euro’s spot price at the expiration date is $118. Consequently, the currency option is said to have expired in the money. Therefore, the investor’s profit is $300, or (100 * ($118 - $115)), less the premium paid for the currency call option.  Read more: Currency Option http:\/\/www.investopedia.com\/terms\/c\/currencyoption.asp#ixzz4rLKRC14k ",
      "CommentNL": "Wat is een ’valuta-optie’ Een valutaoptie is een contract dat de koper het recht maar niet de verplichting geeft om een ??bepaalde valuta tegen een bepaalde wisselkoers op of voor een bepaalde datum te kopen of verkopen. Voor dit recht wordt een premie betaald aan de verkoper, waarvan het bedrag varieert afhankelijk van het aantal contracten als de optie op een beurs wordt gekocht, of van het nominale bedrag van de optie als het over-the- wordt gedaan. tegenmarkt. Valutaopties zijn een van de meest voorkomende manieren waarop bedrijven, particulieren of financiële instellingen zich kunnen indekken tegen ongunstige wisselkoersschommelingen.  UITBREIDING ’Valuta-optie’ Beleggers kunnen zich indekken tegen valutarisico’s door een put of call in valuta te kopen. Het kopen van een put geeft de houder het recht, maar niet de verplichting, om een ??valuta tegen een bepaalde koers tegen een bepaalde datum te verkopen; een call is het recht om de valuta te kopen. Een belegger die geen onderliggende blootstelling heeft, kan een speculatieve positie in een valuta innemen door een put of call te kopen of verkopen. Een persoon of instelling die een put verkoopt, heeft dan de verplichting om de valuta te kopen, terwijl de verkoper van een call de verplichting heeft om deze te kopen.  Basics De prijsstelling van opties heeft verschillende componenten. De strike is het tarief waartegen de eigenaar van de optie in staat is om de valuta te kopen, als de belegger een long-call heeft, of deze te verkopen als de belegger long-put is. Op de expiratiedatum van de optie, ook wel de vervaldatum genoemd, wordt de uitoefenprijs vergeleken met de dan geldende spotkoers. Afhankelijk van het type optie en waar de spotkoers wordt verhandeld, wordt in relatie tot de strike de optie uitgeoefend of vervalt deze waardeloos. Als de optie in geld vervalt, wordt de valutaoptie in contanten verrekend. Als de optie uit het geld vervalt, vervalt het waardeloos.  Voorbeeld Stel dat een belegger optimistisch is over de euro en denkt dat deze zal stijgen ten opzichte van de Amerikaanse dollar. Daarom koopt de belegger een valutacalloptie op de euro met een uitoefenprijs van $ 115, aangezien valutaprijzen worden genoteerd als 100 keer de wisselkoers. Wanneer de belegger het contract koopt, is de contante koers van de euro gelijk aan $ 110. Stel dat de spotprijs van de euro op de vervaldatum $ 118 is. Bijgevolg zou de valuta-optie in het geld zijn verlopen. Daarom is de winst van de investeerder $ 300, of (100 * ($ 118 - $ 115)), verminderd met de premie die is betaald voor de valutacalloptie.  Lees meer: ??Valuta-optie http:\/\/www.investopedia.com\/terms\/c\/currencyoption.asp#ixzz4rLKRC14k",
