      "Comment": "What is ’Swaption (Swap Option)’ A swaption (swap option) is the option to enter into an interest rate swap or some other type of swap. In exchange for an option premium, the buyer gains the right but not the obligation to enter into a specified swap agreement with the issuer on a specified future date.  BREAKING DOWN ’Swaption (Swap Option)’ There are two different kinds of swaptions: a payer swaption and a receiver swaption. In a payer swaption, the purchaser has the right, but not the obligation, to enter into a swap contract where he becomes the fixed-rate payer and the floating-rate receiver. A receiver swaption is the opposite; the purchaser has the option to enter into a swap contract where he will receive the fixed rate and pay the floating rate. Swaptions are over-the-counter contracts and are not standardized like equity options or futures contracts. Thus, the buyer and seller need to both agree to the price of the swaption, the time until expiration of the swaption, the notional amount, and the fixed and floating rates.  Beyond these terms, the buyer and seller must agree whether the swaption style will be Bermudan, European or American. These style names have nothing to do with geography, but instead with how the swaption can be executed. With a Bermudan swaption, the purchaser is allowed to exercise the option and enter into the specified swap on a predetermined set of specific dates. With a European swaption, the purchaser is only allowed to exercise the option and enter into the swap on the expiration date of the swaption. With an American-style swaption, the purchaser can exercise the option and enter into the swap on any day between the origination of the swap and the expiration date. Since swaptions are custom contracts, more creative terms are also possible.  The Swaption Market Swaptions are generally used to hedge options positions on bonds, to aid in restructuring current positions another swaps, with structured notes, and to alter an entire portfolio or firm’s aggregate payoff profile. Because of the nature in which swaptions are used, the market participants are typically large financial institutions, banks and hedge funds. Large corporations also participate in the market to help manage interest rate risk. Contracts are offered in most of the major world currencies. The large investment and commercial banks are generally the main market makers, because the immense technological and human capital required to monitor and maintain a portfolio of swaptions is usually out of the reach of smaller-sized firms.  Read more: Swaption (Swap Option) Definition | Investopedia http:\/\/www.investopedia.com\/terms\/s\/swaption.asp#ixzz4Zb0bujBq",
      "CommentNL": "Wat is ’Swaption (Swap-optie)’ Een swaption (swapoptie) is de mogelijkheid om een ??renteswap of een ander soort swap af te sluiten. In ruil voor een optiepremie verkrijgt de koper het recht maar niet de verplichting om op een bepaalde datum in de toekomst een bepaalde swapovereenkomst met de uitgevende instelling aan te gaan.  UITBREIDING ’Swaption (Swap Option)’ Er zijn twee verschillende soorten swaptions: een payer swaption en een receiver swaption. Bij een payer swaption heeft de koper het recht, maar niet de plicht, om een ??swapcontract aan te gaan waarbij hij de betaler van de vaste rente en de ontvanger van de variabele rente wordt. Een receiver swaption is het tegenovergestelde; de koper heeft de mogelijkheid om een ??swapcontract af te sluiten waarbij hij de vaste rente ontvangt en de variabele rente betaalt. Swaptions zijn over-the-counter-contracten en zijn niet gestandaardiseerd zoals aandelenopties of futures-contracten. De koper en verkoper moeten dus beiden akkoord gaan met de prijs van de swaption, de tijd tot het verstrijken van de swaption, het notionele bedrag en de vaste en variabele rente.  Buiten deze voorwaarden moeten de koper en verkoper overeenkomen of de swaption-stijl Bermudan, Europees of Amerikaans is. Deze stijlnamen hebben niets te maken met geografie, maar met hoe de swaption kan worden uitgevoerd. Met een Bermudan-swaption mag de koper de optie uitoefenen en de gespecificeerde swap aangaan op een vooraf bepaalde set van specifieke data. Bij een Europese swaption mag de koper de optie alleen uitoefenen en de swap aangaan op de vervaldatum van de swaption. Met een swaption in Amerikaanse stijl kan de koper de optie uitoefenen en de swap aangaan op elke dag tussen het ontstaan ??van de swap en de vervaldatum. Omdat swaptions op maat gemaakte contracten zijn, zijn creatievere voorwaarden ook mogelijk.  De Swaption-markt Swaptions worden over het algemeen gebruikt om optieposities op obligaties af te dekken, om te helpen bij het herstructureren van huidige posities met andere swaps, met gestructureerde notes, en om het totale uitbetalingsprofiel van een hele portefeuille of bedrijf te wijzigen. Vanwege de aard waarin swaptions worden gebruikt, zijn de marktdeelnemers doorgaans grote financiële instellingen, banken en hedgefondsen. Grote bedrijven nemen ook deel aan de markt om het renterisico te helpen beheersen. Contracten worden aangeboden in de meeste van de belangrijkste valuta’s ter wereld. De grote investerings- en commerciële banken zijn over het algemeen de belangrijkste marktmakers, omdat het enorme technologische en menselijke kapitaal dat nodig is om een ??portefeuille van swaptions te monitoren en te onderhouden, meestal buiten het bereik van kleinere bedrijven ligt.  Lees meer: ??Swaption (Swap Option) Definitie | Investopedia http:\/\/www.investopedia.com\/terms\/s\/swaption.asp#ixzz4Zb0bujBq",
