      "CommentNL": "Een formele relatie die 2 personen met elkaar hebben. College van toezicht en advies in een naamloze of besloten vennootschap, eventueel ook in een stichting. De raad controleert het bestuur (de directie) en staat deze met raad en daad bij. De raad bestuurt echter niet. Voor naamloze vennootschappen en besloten vennootschappen met beperkte aansprakelijkheid, die tenminste drie jaar onafgebroken in het Handelsregister als ‘grote vennootschap’ zijn ingeschreven, dit wil zeggen met een eigen vermogen van minimaal 10 miljoen gulden, een wettelijk verplichte ondernemingsraad, een personeelsbestand van tenminste 100 werknemers en is een raad van commissarissen wettelijk verplicht.",
