      "Parent Entity#Code": "derivaat",
      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "DEFINITION of ’Interest Rate Options’ An investment tool whose payoff depends on the future level of interest rates. Interest rate options are both exchange traded and over-the-counter instruments.   BREAKING DOWN ’Interest Rate Options’ Interest rate options from exchanges in the United States are offered on Treasury bond futures, Treasury note futures and eurodollar futures. An investor taking a long position in interest rate call options believes that interest rates will rise, while an investor taking a position in interest rate put options believes that interest rates will fall.   Read more: Interest Rate Options http:\/\/www.investopedia.com\/terms\/i\/interestrateoptions.asp#ixzz4rLK6voEs   Cap en Floor zijn vormen van Interest Rate Option. ",
      "CommentNL": "DEFINITIE van ’Rente-opties’ Een investeringstool waarvan de uitbetaling afhangt van het toekomstige rentepeil. Renteopties zijn zowel op de beurs verhandelde als over-the-counter-instrumenten.  UITBREIDING ’Rente-opties’ Renteopties van beurzen in de Verenigde Staten worden aangeboden op schatkistfutures, schatkistfutures en eurodollar-futures. Een belegger die een longpositie neemt in putopties op rente, denkt dat de rente zal stijgen, terwijl een belegger die een positie neemt in putopties op rente denkt dat de rente zal dalen.  Lees meer: Rente-opties http:\/\/www.investopedia.com\/terms\/i\/interestrateoptions.asp#ixzz4rLK6voEs  Cap en Floor zijn vormen van Rentevoetoptie.",
      "Creator": "unlopo",
