      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "Ratings are indicators that provide insight into the level of reliability \/ risk of the financial institutions with which The Firm does business. These ratings are determined by rating agencies (Fitch, Moodies, Standard & Poors). Financial institutions for which ratings are required: - Issuers of securities - Institutions where The Firm maintains a nostro account (Nostro settings) - Treasury counterparties: financial institutions with which thefirm executes treasury deals  Rating agencies are not obliged to provide a rating for every company. That is why not all companies are rated. Rating agencies can issue different types of ratings per company. A company can therefore have several ratings issued by the same rating agency. Each rating type has its own meaning \/ purpose.",
      "CommentNL": "Ratings zijn indicatoren die inzicht geven in de mate van betrouwbaarheid\/risico van de financiële instellingen waarmee The Firm zaken doet. Deze ratings worden bepaald door ratingbureaus (Fitch, Moodies, Standard & Poors). Financiële instellingen waarvoor ratings vereist zijn: - Uitgevende instellingen van effecten - Instellingen waar The Firm een nostro account aanhoudt (Nostro instellingen) - Treasury tegenpartijen: financiële instellingen waarmee thefirm treasury-deals aangaat  Ratingbureaus zijn niet verplicht om voor elk bedrijf een rating te geven. Daarom worden niet alle bedrijven beoordeeld. Ratingbureaus kunnen per bedrijf verschillende soorten ratings afgeven. Een bedrijf kan dus meerdere ratings laten afgeven door hetzelfde ratingbureau. Elk beoordelingstype heeft zijn eigen betekenis \/ doel.",
      "Creator": "unstek",
