      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "An institution that acts on behalf of the issuer of securities in distributing the securities and in realising the proceeds thereof for the benefit of the issuer.  Also, on behalf of an issuer, an IPA makes payments to holders of securities.  Related to financial securities, an Issuing and Paying Agent (IPA) performs the following functions: -issuing securities upon Issuer orders, -collecting funds from the Issuer to make interest and principal payments to bondholders, -arranging payment of coupons and matured bonds, and for cancelation and destruction, and -processing transfers of ownership of securities.",
      "CommentNL": "Een instelling die namens de emittent van effecten optreedt bij de distributie van de effecten en bij het realiseren van de opbrengst daarvan ten behoeve van de emittent. Ook verricht een IPA namens een emittent betalingen aan houders van effecten. Met betrekking tot financiële effecten vervult een Issuing and Paying Agent (IPA) de volgende functies: - effecten uitgeven op orders, - het innen van fondsen van de Emittent om rente - en hoofdsombetalingen te doen aan obligatiehouders, - het verwerken van eigendomsoverdrachten van effecten.",
      "Creator": "unlopo",
