      "Vervallen": "0",
      "Comment": "A part of The Firm with its own legal personality, with which The Firm has a financial obligation. Internal entities are financial or non-financial companies, where The Firm has an interest: - full daughters: 100% interest - majority holdings: 50 - 100% interest, such as The Firm Chabot - minority interests: 0 - 49% interest.  From a minority participation you will not see any administration in The Firm’s books. Earnings from minority holdings are shown on the financial statements.  Examples of internal entities: - Messaninne 1 (entity code 601) - Messaninne 2 (entity code 602) - The Firm CH (entity code 907) - Kempen & Co (entity code 909) - The Firm BE (entity code 916) - Quion (entity code 918)  The Firm is often the only customer of an internal entity that we need to have (R \/ C ratio od Deposit \/ Loan). The Firm then has an intercompany relationship with this internal entity (’daughter’).",
