      "Stereotype": "",
      "Vervallen": "1",
      "Comment": "For a change for the Primavera project, a request has been made to deliver the cover per product at a lower level. This is for the benefit of abbacus. Instead of product, the level is now per collateral per product.  Loet: 8\/14\/2017: Bank guarantees are understood to mean a guarantee that The Firm provides to a third party on behalf of the customer. This guarantee cannot be used by the customer as Security \/ collateral for thefirm. Proposal: let it expire",
      "CommentNL": "Voor een change voor het Primavera project is een verzoek gekomen om de dekkingen per product op een lager niveau aan te leveren. Dit is ten behoeve van abbacus.  Het niveau is in plaats van product, nu op per onderpand per product.  Loet: 14-8-2017: Onder bankgaranties wordt een garantie verstaan die The Firm aan een derde partij verstrekt tbv de klant. Deze garantie kan niet door de klant als Zekerheid\/onderpand worden gebruikt voor thefirm. Voorstel: laten vervallen",
