      "Comment": "Code system for classifying the interest rate form of a loan component of a mortgage (Start\/Vast\/Comfort\/Medium\/Variable\/Garantie\/Euribor).  Debit interest is the interest that is charged on the debit balance. A positive debit interest rate leads to a debit entry (the customer pays). A negative debit interest rate leads to a credit entry (the customer receives).",
      "CommentNL": "Codestelsel voor het classificeren van de rentevorm van een leningdeel van een hypotheek (Start\/Vast\/Comfort\/Middel\/Variable\/Garantie\/Euribor).  Debetrente is de rente, die over het debet saldo wordt berekend. Een positief debet rentepercentage leidt tot een debet boeking (de klant betaalt). Een negatief debet rentepercentage leidt tot een een credit boeking (de klant ontvangt). ",
