      "Parent Entity#Name": "",
      "Parent Entity#Code": "",
      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "Certain Derivatives consist of several components, also known as the ’legs’. An example of this is a swap, in which one party exchanges a certain cash flow or risk with that of another party. The expression comes from the English verb ’to swap’.  Loet (23-10-2017): In the TDM, all legs of a derivative ended up in table TDM.derivaat_leg. The different derivative types and their legs were not correctly modeled in the CDM at the time. All attributes are resp. ended up in entity Derivatives and Derivatives.",
      "CommentNL": "Bepaalde Derivaten bestaan uit meerdere componenten, ook wel de ’poten’ (legs) genaamd.  Een voorbeeld hiervan is een swap, waarbij een partij een bepaalde kasstroom of risico ruilt met dat van een andere partij.  De uitdrukking is afkomstig van het Engelse werkwoord ’to swap’ (ruilen, omwisselen).   Loet (23-10-2017): In het TDM zijn alle legs van een derivaat in tabel TDM.derivaat_leg terecht gekomen. De verschillende derivaattypen en hun legs zijn toen niet juist in het CDM gemodelleerd. Alle attributen zijn resp. in entiteit Derivaat en Derivaatleg terecht gekomen.",
