      "Domain": "Collaterals",
      "Name": "real estate pre-registered",
      "Code": "kadastergoed voorbelast",
      "Parent Entity#Name": "",
      "Parent Entity#Code": "",
      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "Several mortgages can be established on one cadastral property. This is recorded by the civil-law notary in the corresponding public register (for immovable property the land registry), where the ranking for enforcement is also recorded. The last mortgage taken out is then preloaded with the previous mortgages.  17-7-2017 (LP): As a result of a data model restriction at Stater (ISHS), input tax cannot be registered and delivered per rank order. This is picked up at Stater, but is unknown when this is implemented. Because preload in MIO is stored per rank order, the preload will be aggregated to collateral during migration. After migration, only the total tender will be known per collateral and will be stored in DWH.zeker_onderpand_voorbelasting. Stater adapts the data model so that preload can be stored and delivered per ranking order. From that moment on, the preload at this level is stored in DWH.security_collateral_precharge.",
      "CommentNL": "Op één kadastergoed kunnen meerdere hypotheken worden gevestigd. Dit wordt door de notaris vastgelegd in het overeenkomstige openbaar register (voor onroerende zaken het kadaster), waarbij tevens de rangorde voor uitwinning wordt vastgelegd. De laatst afgesloten hypotheek is dan voorbelast met de voorgaande hypotheken.  17-7-2017 (LP): Als gevolg van een datamodel beperking bij Stater (ISHS) kan voorbelasting niet per rangorde worden geregistreerd en worden aangeleverd. Dit wordt opgepakt bij Stater alleen is onbekend wanneer dit wordt doorgevoerd.  Omdat voorbelasting in MIO wel per rangorde wordt opgeslagen zal tijdens migratie de voorbelasting worden geaggregeerd tot onderpand. Na migratie zal per onderpand dus enkel de totale inschrijving bekend zijn en worden opgeslagen in DWH.zekerheid_onderpand_voorbelasting.  Stater past het datamodel aan zodat voorbelasting wel per rangorde kan worden opgeslagen en aangeleverd. Vanaf dat moment wordt de voorbelasting op dit niveau opgeslagen in DWH.zekerheid_onderpand_voorbelasting.",
