      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "An UBO or Ultimate Beneficial Owner is the (natural) person or organization that is the ultimate beneficiary when an institution initiates a transaction.  An UBO of an organization is a (natural) person who: • Holds an interest of minimum 25% capital of the legal entity • Has minimum 25% voting rights at the general meeting of shareholders • Receives minimum 25% of said legal entity’s capital as beneficiary  ",
      "CommentNL": "Een UBO of Ultimate Beneficial Owner is de (natuurlijke) persoon of organisatie die de uiteindelijke begunstigde is wanneer een instelling een transactie initieert. Een UBO van een organisatie is een (natuurlijk) persoon die: • Heeft een belang van minimaal 25% in het kapitaal van de rechtspersoon • Heeft minimaal 25% stemrecht op de algemene vergadering van aandeelhouders • Ontvangt minimaal 25% van het vermogen van genoemde rechtspersoon als begunstigde",
      "Creator": "unlopo",
