      "Parent Entity#Code": "",
      "Stereotype": "",
      "Vervallen": "1",
      "Comment": "Treasury deals are contracts managed by the The Firm Treasury department. Treasury involves the management of money and financial risks in a business.  Its priority is to ensure the business has the money it needs to manage its day-to-day business obligations, while also helping develop its long term financial strategy and policies.  Loet (23-10-2017): it is unclear whether this should be a separate entity or whether these are attributes of the (underlying) Derivative \/ leg.",
      "CommentNL": "Treasury deals zijn contracten die worden beheerd door de afdeling Treasury van The Firm. Treasury omvat het beheer van geld en financiële risico’s in een bedrijf.  De prioriteit is ervoor te zorgen dat het bedrijf het geld heeft dat het nodig heeft om zijn dagelijkse zakelijke verplichtingen te beheren, terwijl het ook helpt bij het ontwikkelen van zijn financiële strategie en beleid op lange termijn.  Loet (23-10-2017): het is onduidelijk of dit een aparte entiteit moet zijn of dat dit attributen zijn van het (onderliggende) Derivaat\/leg.",
