      "Comment": "A corporate action is any activity that brings material change to an organization and impacts its stakeholders, including shareholders, both common and preferred, as well as bondholders. These events are generally approved by the company’s board of directors; shareholders may be permitted to vote on some events as well. Some corporate actions require shareholders to submit a response.",
      "CommentNL": "Een corporate action is elke activiteit die materiële verandering teweegbrengt in een organisatie en gevolgen heeft voor haar stakeholders, inclusief aandeelhouders, zowel gewone als preferente, evenals obligatiehouders. Deze evenementen worden over het algemeen goedgekeurd door de raad van bestuur van het bedrijf; aandeelhouders kunnen mogelijk ook stemmen op sommige evenementen. Sommige corporate actions vereisen dat aandeelhouders een reactie indienen.",
