      "Code": "client riskunit",
      "Parent Entity#Name": "",
      "Parent Entity#Code": "",
      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "A RiskUnit is a system of Portfolio numbers, which has been compiled by the Bijzonderbeheer department and of which one Portfolio number has been identified as the Main Customer by the Bijzonderbeheer depoartment. The Portfolio numbers are linked to the RiskUnit, which are legally liable for the same credit or for each other’s credits, in other words, for which collateral is provided jointly and \/ or a joint provision is made. The structure of a RiskUnit is initially derived from the Credit Information System. Additional Relations can be added to a RiskUnit at the discretion of the Bijzonderbeheer department.  Example: Relationship 9901 is the mother of relationship 9902 and relationship 9903, together they form an AI system. If relationship 9901 is included in the BAT, relationship 9902 and 9903 are automatically included. If, according to the definition, relationship 9905 also falls under the Risk Unit, without it being in the AI system, then relationship 9905 can be added to the RiskUnit.",
      "CommentNL": "Een Riskunit is een stelsel van Client portfolios, dat is samengesteld door afdeling Bijzonderbeheer en waarvan één Client portfolio door Bijzonderbeheer als Hoofdklant is gekenmerkt. Aan het Riskunit stelsel zijn de Client portfolio gekoppeld, die jurdische gezien aansprakelijke zijn voor hetzelfde krediet of voor de kredieten van elkaar oftewel, waarvoor gezamenlijk zekerheden gelden en\/of een gezamenlijke voorziening getroffen wordt.  De opbouw van een Riskunit wordt initieel afgeleid van het Krediet Informatie Stelsel. Aan een Riskunit kunnen naar inzicht van Bijzonder beheer aanvullende Relaties worden toegevoegd.   Voorbeeld: Client portfolio 9901 is de moeder van Client portfolio 9902 en Client portfolio 9903, ze vormen samen een KI-stelsel. Als Client portfolio 9901 opgenomen wordt in de BBT, dan komen Client portfolio 9902 en 9903 automatisch mee. Als nu Client portfolio 9905 volgens de definitie ook onder de Riskunit valt, zonder dat deze in het KI stelsel zit, dan kan Client portfolio 9905 worden toegevoegd aan de Risk Unit.  ",
