      "Name": "creditrisk default",
      "Code": "creditrisk default",
      "Parent Entity#Name": "",
      "Parent Entity#Code": "",
      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "Credit risk default involves calculating the realized EAD and realized LGD. The Realized EAD is the actual outstanding amount of a product, where a Relationship is in default. This corrects incorrect repayments with Payment account on mortgage. The correction determines the risk of the product.  Exposure at default (EAD) is the total value a bank is exposed to when a loan defaults.  Loss given default (LGD) is the amount of money a bank or other financial institution loses when a borrower defaults on a loan, depicted as a percentage of total exposure at the time of default. ",
      "CommentNL": "Creditrisk default omvat het berekenen van de gerealiseerde EAD en gerealiseerde LGD. De Gerealiseerde EAD is het daadwerkelijk uitstaande bedrag van een product, waarbij een Relatie in default is. Hiermee worden onterechte aflossingen met Betaalrekening op hypotheek gecorrigeerd. De correctie zorgt voor het bepaen van hetv risico op het product.  Exposure at default (EAD) is de totale waarde waaraan een bank wordt blootgesteld wanneer een lening in gebreke blijft. Loss given default (LGD) is het geldbedrag dat een bank of andere financiële instelling verliest wanneer een lener in gebreke blijft bij een lening, weergegeven als een percentage van de totale blootstelling op het moment van wanbetaling.",
      "Creator": "unlopo",
      "Creation Date": "Tuesday 7 March 2017 09:16:38",
      "Modifier": "unlopo",
      "Modification Date": "Wednesday 30 March 2022 12:42:10",
      "DataClassification": "Inheritance entity",
