      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "All current products from DWH are collected in the Creditrisk Extended calculator, and the credit risk approach according to CRR is assigned to this. - If the product is classified in the Credit Risk calculator in basel_asset_class RM - Then the credit risk approach AIRB - Otherwise, the credit risk approach becomes SA.",
      "CommentNL": "In de calculator Creditrisk Extended worden àlle actuele producten uit DWH verzameld, en hieraan wordt de kredietrisico benadering volgens CRR toegekend. - Indien het product in de Credit Risk calculator is ingedeeld in basel_asset_class RM  - Dan wordt de kredietrisico benadering AIRB - Anders wordt de kredietrisico benadering SA.  ",
