      "Code": "creditrisk parameters",
      "Parent Entity#Name": "",
      "Parent Entity#Code": "",
      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "Credit risk parameters is understood to mean the calculation of the parameters PD, LGD and EAD. - Probability of Default (PD) is the expected probability that a Relation and Product will default. To determine the PD, predictive variables are calculated that look at the behavior of the Customer on the Payment Account. - Loss Given Default (LGD) is the expected loss on a credit product (if in default). - Exposure at default (EAD) is the amount or debt outstanding on a credit product.",
      "CommentNL": "Onder Creditrisk Parameters wordt het berekenen van de parameters PD, LGD en EAD verstaan. - Probability of Default (PD) is de verwachte kans dat een Relatie en Product in default gaat. Om de PD te bepalen worden predictieve variabelenberekend die kijken naar het gedrag van de Klant op de Betaalrekening. - Loss Given default (LGD) is het verwachte verlies over een kredietproduct (indien in default). - Exposure at default (EAD) is het uitstaande bedrag of schuld over een kredietproduct.",
      "Creator": "unlopo",
      "Creation Date": "Tuesday 7 March 2017 09:16:37",
      "Modifier": "unlopo",
      "Modification Date": "Wednesday 30 March 2022 12:42:10",
      "DataClassification": "Inheritance entity",
