      "Vervallen": "0",
      "Comment": "Classifications of Securities Instruments. Several code systems are available to classify instruments: - ISO 10962  generally known as CFI (Classification of Financial Instruments) - Global Industry Classification Standard (GICS) is an industry taxonomy developed in 1999 by MSCI and Standard & Poor’s (S&P) - The Asset Classification Code is the new asset classification standard that will be used across the entire investment spectrum of The Firm Nederland. - CDM Instrument classification: classification scheme that encodes Instrument types, according to CDM classification.",
      "CommentNL": "Classificaties van Securities Instruments. Er zijn meerdere codestelsels beschikbaar om instrumenten te classificeren: - ISO 10962 algemeen bekend als CFI (classificatie van financiële instrumenten) - Global Industry Classification Standard (GICS) is een branchetaxonomie die in 1999 is ontwikkeld door MSCI en Standard & Poor’s (S&P) - De Asset Classificatie Code is de nieuwe asset classificatie standaard, die binnen het gehele beleggingsspectrum van The Firm Nederland gebruikt gaat worden. - CDM Instrument classification: classificatieschema dat instrumenttypes codeert, volgens CDM-classificatie.",
