      "Parent Entity#Code": "",
      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "Describes the rating of an instrument. A rating is a risk indicator . A poor rating means a high risk. Ratings can determined internally or externally. External ratings are supplied by the following rating agencies” Moody’s, Standard Poor’s, and Fitch. Rating agencies are not obliged to rate every instrument. Therefore, not all instruments have a rating. Rating agencies can issue multiple rating types per instrument. Thus, an instrument can have multiple ratings issued by the same rating agency. Each rating type has its own meaning\/purpose.  Rating types: - Kempen credit rating: Credit Rating as determined by The Firm, based on credit ratings provided by thorn rating agencies. - Bloomberg Composite rating  - Moodies nowatch rating - Fitch nowatch rating - Standard & Poor’s nowatch rating ",
      "CommentNL": "Beschrijft de classificatie van een instrument. Een rating is een risico-indicator. Een slechte rating betekent een hoog risico. Ratings kunnen intern of extern worden bepaald. Externe ratings worden verstrekt door de volgende ratingbureaus: Moody’s, Standard Poor’s en Fitch. Ratingbureaus zijn niet verplicht om elk instrument te beoordelen. Daarom hebben niet alle instrumenten een rating. Ratingbureaus kunnen per instrument meerdere ratingtypes afgeven. Zo kan een instrument meerdere ratings hebben die zijn afgegeven door hetzelfde ratingbureau. Elk beoordelingstype heeft zijn eigen betekenis\/doel.",
