      "Parent Entity#Code": "hypotheek achterstand",
      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "A mortgage is a contract for a loan for the purchase of real estate established in the Netherlands with the same real estate as collateral (mortgage security). A mortgage generally has a long term. If the mortgage cannot be paid, the bank will seize the property (the bank then seizes the property). For taking out a mortgage, the mortgagor (the person who buys the property) pays closing costs. The bank that provides the mortgage is the mortgagee.  A mortgage consists of 1 or more loan components.",
      "CommentNL": "Een Woninghypotheek is contract voor een lening voor de aanschaf van een in Nederland gevestigd onroerend goed met ditzelfde onroerend goed als onderpand (hypothecaire zerkerheid).  Een Woninghypotheek heeft in het algemeen een lange looptijd. Wanneer de Woninghypotheek niet kan worden voldaan legt de bank beslag op het onroerend goed (de bank legt dan beslag op het pand).  Voor het afsluiten van een Woninghypotheek betaalt de hypotheekgever (degene die het onroerend goed koopt) afsluitkosten. De bank die de Woninghypotheek verstrekt is de hypotheeknemer.  Kenmerken van een Woninghypotheek zijn: hoofdsom, economische looptijd, rente looptijd, rente percentage, rentevorm, rente berekenmethode.  Een Woninghypotheek bestaat uit 1 of meerdere leningdelen.",
      "Creator": "fnrime",
      "Creation Date": "Wednesday 11 March 2015 10:45:44",
      "Modifier": "unlopo",
      "Modification Date": "Wednesday 30 March 2022 16:46:03",
      "DataClassification": "Master entity",
