      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "A formal relationship between the client and another party. A mutual fund is a fund usually with an (independent) custodian and an (independent) manager, in which assets have been raised by several parties with one (or more) common investment objective(s).  DQ; an organization with legal form Joint account fund must always have a custodian ",
      "CommentNL": "Een formele relatie die 2 personen met elkaar hebben. De bloot eigenaar is de eigenaar van een goed (zaak- of vermogensrecht), terwijl een ander een beperkt zakelijk recht op dat goed heeft. Het betreft meestal een recht op een onroerende zaak.  Door het recht van die ander heeft de bloot eigenaar over het algemeen niet de directe beschikking over zijn goed. Het goed zelf wordt de bloot eigendom genoemd. Soms wordt door de genothebbende wel een vergoeding aan de bloot eigenaar betaald.  ",
