      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "An instrument is a means by which something of value is transferred, held, or accomplished. In the field of finance, an instrument is a tradable asset, or negotiable item, such as a security, commodity, derivative, or index, or any item that underlies a derivative. In separate contexts, an instrument can alternatively refer to an economic variable that can be controlled or altered by government policymakers to effect a change in other economic indicators. It can also refer to a legal document such as a contract, will, or deed. Source: Investopedia",
      "CommentNL": "Een instrument is een middel waarmee iets van waarde wordt overgedragen, vastgehouden of bereikt. Op financieel gebied is een instrument een verhandelbaar actief of verhandelbaar item, zoals een effect, grondstof, derivaat of index, of elk item dat ten grondslag ligt aan een derivaat. In afzonderlijke contexten kan een instrument ook verwijzen naar een economische variabele die kan worden gecontroleerd of gewijzigd door beleidsmakers van de overheid om een verandering in andere economische indicatoren te bewerkstelligen. Het kan ook verwijzen naar een juridisch document zoals een contract, testament of akte. Bron: Investopedia",
