      "Comment": "Under the new IFRS9 accounting standard, provisions need to be determined based on a one-year or lifetime expected credit loss calculation. Like for the calculation of regulatory capital, one is required to determine the exposure at default (EAD). Furthermore, for IFRS9 purposes one needs to determine the EAD for future time periods during the lifetime of a financial asset in scope of IFRS9. This differs with the current EAD estimate for risk management and regulatory purposes, as the current estimate is on the current reporting date and a risk horizon of one-year.  In order to determine future EADs, differences in the redemption profiles, interest rates, limits and outstanding amounts and product characteristics such as revolving and maturing should be taken into account. The exposure at the moment of default is product-specific and cannot be simply defined based on an aggregated outstanding amount or aggregated limit per contract or client. For example, a non-revolving retail mortgage could either be an annuity loan or have a linear repayment schedule, by definition, both mortgage types will provide different EAD values.  As a consequence, EAD needs to be segmented on product level. This approach is in line with the current scope of application under the IRB models. This document focusses on the functional requirements for applying the aforementioned product level segmentation. In term of products the scope of the IFRS9 EAD model do not differ from the currently used IRB models. Any products related to assets for which capital requirements are calculated based on the standardized approach (SA) are excluded.  A product level segmentation is applied  to the following portfolios: • Retail Mortgages • Retail Other • SME • QRRE • Non-Retail (includes PKR products)  Note that we ground our product segmentation choices based on our core IFRS9 modeling principle:  v “IFRS9 modelling methodology should be consistent with the existing modelling approach for CRR as much as possible”",
      "CommentNL": "Volgens de nieuwe IFRS9-boekhoudnorm moeten voorzieningen worden bepaald op basis van een eenjaars- of levenslange verwachte kredietverliezenberekening. Net als bij de berekening van het reglementair kapitaal, is het vereist om de exposure at default (EAD) te bepalen. Bovendien moet men voor IFRS9-doeleinden de EAD bepalen voor toekomstige perioden tijdens de levensduur van een financieel actief in het toepassingsgebied van IFRS9. Dit wijkt af van de huidige EAD-schatting voor risicomanagement- en regelgevingsdoeleinden, aangezien de huidige schatting op de huidige rapportagedatum is en een risicohorizon van één jaar. Om toekomstige EAD’s te bepalen, moet rekening worden gehouden met verschillen in de aflossingsprofielen, rentetarieven, limieten en uitstaande bedragen en productkenmerken zoals revolvering en vervaldatum. De blootstelling op het moment van wanbetaling is productspecifiek en kan niet eenvoudig worden bepaald op basis van een geaggregeerd uitstaand bedrag of geaggregeerde limiet per contract of klant. Een niet-doorlopende particuliere hypotheek kan bijvoorbeeld een annuïtaire lening zijn of een lineair aflossingsschema hebben, beide hypotheektypen zullen per definitie verschillende EAD-waarden bieden. Als gevolg hiervan moet EAD worden gesegmenteerd op productniveau. Deze aanpak is in lijn met het huidige toepassingsgebied onder de IRB-modellen. Dit document richt zich op de functionele eisen voor het toepassen van de hiervoor genoemde segmentatie op productniveau. Qua producten verschilt de reikwijdte van het IFRS9 EAD-model niet van de momenteel gebruikte IRB-modellen. Alle producten die verband houden met activa waarvoor kapitaalvereisten worden berekend op basis van de standaardbenadering (SA), zijn uitgesloten. Een segmentering op productniveau wordt toegepast op de volgende portfolio’s: • particuliere hypotheken • Detailhandel Overig • MKB • QRRE • Niet-detailhandel (inclusief PKR-producten)  Merk op dat we onze keuzes voor productsegmentatie baseren op ons kernprincipe van IFRS9-modellering: v ’IFRS9-modelleringsmethodologie moet zoveel mogelijk consistent zijn met de bestaande modelleringsbenadering voor CRR’",
