      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "A formal relationship that 2 people have with each other. Director or director[1] is the general name for someone who is in charge of an organization, company, service or department. For example, this person may be in charge of a commercial or industrial enterprise, hospital, school, museum, etc. (e.g., financial director, personnel director, school director, etc.).  Nowadays, in the trade and business world, English jargon is often used; one then refers to the CEO (chief executive officer) when one means the director of a company.  The persons who fulfill the directorships in an organization are collectively referred to as the board of directors. In the civil service world one speaks of management as a synonym for the department concerned. For example, one speaks of the logistics department, the personnel department, the culture department, or at the various tax authorities: first, second, third, etc. management.",
      "CommentNL": "Een formele relatie die 2 personen met elkaar hebben. Directeur of directrice[1] is de algemene benaming voor iemand die de leiding heeft over een organisatie, bedrijf, dienst of afdeling. Deze persoon kan bijvoorbeeld de leiding geven aan een handels- of industriële onderneming, ziekenhuis, school, museum etc. (bijvoorbeeld financieel directeur, personeelsdirecteur, schooldirecteur enz.).   In de handels- en bedrijfswereld hanteert men daarvoor tegenwoordig vaak Engelstalig jargon; men heeft het dan over de CEO (chief executive officer) als men de directeur van een bedrijf bedoelt.   De personen die in een organisatie de directeursfuncties vervullen worden gezamenlijk de directie genoemd. In de ambtelijke wereld spreekt men van directie als synoniem voor de betreffende afdeling. Zo spreekt men bijvoorbeeld van de directie logistiek, de directie personeel, de directie cultuur, of bij de diverse belastingdiensten: eerste, tweede, derde enz. directie.    ",
