      "Comment": "A debtor, legal debtor, is a Relationship who has an obligation to the bank. After entering into a two-way agreement, but before any performance is achieved, both parties are usually both creditor and debtor. After one party has delivered and the other has not yet, the first party is only a creditor and the other is only a debtor.",
      "CommentNL": "Een debiteur, juridisch schuldenaar, is een Relatie die een verplichting heeft ten opzichte van de bank.  Na het sluiten van een tweezijdige overeenkomst, maar voordat er prestaties zijn geleverd, zijn beide partijen meestal zowel schuldeiser als schuldenaar. Nadat de ene partij zijn prestatie heeft geleverd en de andere nog niet is de eerstgenoemde partij alleen schuldeiser en de andere alleen schuldenaar. ",
