      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "Delivery Versus Payment account. Delivery versus payment (DVP) is a securities industry settlement method that guarantees the transfer of securities only happens after payment has been made. DVP stipulates that the buyer’s cash payment for securities must be made prior to or at the same time as the delivery of the security.",
      "CommentNL": "Levering versus betaalrekening (Administratieve rekening).  Levering tegen betaling (DVP) is een afwikkelingsmethode in de effectensector die garandeert dat de overdracht van effecten pas plaatsvindt nadat de betaling heeft plaatsgevonden.  DVP bepaalt dat de contante betaling van de effecten door de koper vóór of gelijktijdig met de levering van de effecten moet plaatsvinden.",
