      "Name": "instrumentcode",
      "Code": "instrumentcode",
      "Parent Entity#Name": "",
      "Parent Entity#Code": "",
      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "Met behulp van de financiele instrumentcode worden financiele instrumenten gecategoriseerd. Dit codestelsel is gebaseerd op de ISO 10962 standaard.  ISO 10962 definieert de structuur en het formaat voor de classificatie van financiële instrumenten die door de International Organization for Standardization (ISO) goedgekeurd. Er zijn vele soorten van financiële instrumenten gebruikt voor het opslaan, investeringen, handel, hedging en speculeren. Deze instrumenten zijn over het algemeen ingedeeld in groepen genaamd ’asset classificaties.’ De meest voorkomende activa classificaties worden in het algemeen beschreven met behulp van termen als ’Equities (Stocks),’ ’Debt (obligaties),’ ’Derivaten (Contracts),’ ’valuta,’ en een paar andere algemene termen.  ISO 10962 biedt een wereldwijde standaard voor deze classificaties in de vorm van specifieke codes. Classificatie van financiële instrumenten (CFI) code wordt gebruikt om te definiëren en te beschrijven financiële instrumenten als een uniforme set van codes voor alle marktdeelnemers. [1] De code wordt uitgegeven door de leden van ANNA, de Association of National Numbering Agencies. De groep is momenteel bezig om de structuur te vereenvoudigen, zodat het op grotere schaal door de deelnemers niet-gouvernementele markt kan worden goedgekeurd.  De alfabetische tekens in elke stand van deze 6 karakter code weerspiegelen specifieke kenmerken inherent aan de financiële instrumenten die in de kwestie van het instrument worden gedefinieerd, en die in de meeste gevallen ongewijzigd blijven gedurende de looptijd van het instrument (of de markt waarop de instrument trades). ",
      "CommentNL": "",
