      "Comment": "A money loan is a money amount provided by The Firm to a client on condition that it is paid back later. In most cases, a fee in the form of interest is paid for and possibly other costs. To emphasize the distinction between the originally borrowed amount on the one hand and the interest and costs on the other hand, the first is also called the principal. Depending on the arrangements, a loan can be repaid, including interest and costs, once or in part. The portion of the principal that has not yet been redeemed is called the residual principal amount.",
      "CommentNL": "Een Geldlening is een geldbedrag dat door The Firm wordt verstrekt aan een client op voorwaarde dat het later terug wordt betaald. Veelal wordt hier een vergoeding in de vorm van rente voor betaald en eventueel andere kosten.  Om het onderscheid te benadrukken tussen het oorspronkelijk geleende bedrag enerzijds en de rente en kosten anderzijds, wordt het eerste ook wel de hoofdsom genoemd.  Afhankelijk van de afspraken kan een lening in een keer of in gedeelten worden afgelost.  Het gedeelte van de hoofdsom dat nog niet is afgelost, wordt de pro resto hoofdsom genoemd.",
