      "Name": "reverse repo",
      "Code": "reverse_repo",
      "Parent Entity#Name": "derivative",
      "Parent Entity#Code": "derivaat",
      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "Contract whereby securities are temporarily purchased for trading or liquidity purposes and sold again on a predetermined date at a predetermined price. Basically the reverse version of a repo.  LoetP: 31-1-2019: after a preliminary analysis by RonaldK, it appears that a Reverse Repo is a Client Portfolio, to which a Loan and Securities Deposit is linked.  Repo stands for ’repurchase agreement’, a repurchase agreement. Also called cession-retrocession (transaction, transaction) in Dutch, but in the financial world the term ’repo’ is more common.  In a repo transaction, securities are sold to a counterparty (cash transaction) in exchange for cash, with the (simultaneous) commitment to repurchase the securities at an agreed time in the future (forward transaction); in essence, the securities are lent (cession) and money is borrowed. With a reverse repo (reverse repurchase agreement) the opposite happens; the securities are borrowed and money is lent.  Repurchase of securities plays an important role in transactions between financial intermediaries as an instrument for attracting or investing money for a usually relatively short term; the repo is a money market transaction. The implicit, risk-free interest rate that is established with the transaction is also called the ’implied repo rate’, but it is actually nothing more than the IRR (’Internal Rate of Return’).  Repo transactions are common in the bond market.",
      "CommentNL": "Contract waarbij effecten tijdelijk worden aangekocht voor handels- of liquiditeitsdoeleinden en op een vooraf bepaalde datum tegen een vooraf bepaalde prijs weer worden verkocht. Eigenlijk de omgekeerde variant van een repo.  LoetP: 31-1-2019: na een voorlopige anlyze door RonaldK lijkt het er op dat een Reverse Repo een Client Portfolio is, waaraan een Geldlening en Effectendepot is gekoppeld.  Repo staat voor ’repurchase agreement’, een overeenkomst voor wederinkoop. In het Nederlands ook cessie-retrocessie (-verrichting, -transactie) genoemd, maar in de financiële wereld is de term ’repo’ gangbaarder.  Bij een repo-transactie verkoopt men effecten aan een tegenpartij (contante transactie) in ruil voor geldmiddelen, met de (gelijktijdige) verbintenis de effecten op een afgesproken tijdstip in de toekomst terug te kopen (termijntransactie); in wezen leent men de effecten uit (cessie) en leent men geldmiddelen. Bij een reverse repo (reverse repurchase agreement) gebeurt het omgekeerde; men leent de effecten en leent geldmiddelen uit.   Cessie-retrocessie van effecten speelt bij verrichtingen tussen financiële bemiddelaars een belangrijke rol als instrument voor het aantrekken of uitzetten van geld voor een meestal vrij korte termijn; de repo is een geldmarkttransactie.  De impliciete, risicovrije rentevoet die wordt vastgelegd met de transactie wordt ook de ’implied repo rate’ genoemd, maar is eigenlijk niets anders dan de IRR (’Internal Rate of Return’, de interne rekenrente).   Repo-transacties komen veel voor in de obligatiemarkt. ",
