      "Vervallen": "0",
      "Comment": "A prospect is a potential client that has been qualified by a sales or marketing professional to be a “good fit” as a customer for The Firm, meaning that they fit The Firm’s target market audience (company size, geographic region, etc.) and they are in a position within their company to influence, decide on and complete the purchasing process.  Prospects don’t need to have shown any actual interest in the goods or services or The Firm \/ brand yet; they just have to meet the initial The Firm’s criteria.",
      "CommentNL": "Een prospect is een potentiële klant die door een verkoop- of marketingprofessional is gekwalificeerd als een ’goede fit’ als klant voor The Firm, wat betekent dat ze passen bij de doelgroep van The Firm (bedrijfsgrootte, geografische regio, enz.) een positie binnen hun bedrijf om het inkoopproces te beïnthefirmoeden, te beslissen en te voltooien. Prospects hoeven nog geen daadwerkelijke interesse in de goederen of diensten of The Firm \/ merk te hebben getoond; ze moeten gewoon voldoen aan de criteria van de initiële The Firm.",
