      "Comment": "Globally, there are only three main ratings agencies that provide credit ratings: Moody’s, Standard & Poor’s (S&P’s), and Fitch Ratings. Each of these agencies aims to provide a rating system to help investors determine the risk associated with investing in a specific company, government, agency, investment instrument, or market.",
