      "Comment": "The United Nations Global Compact is a United Nations initiative to encourage businesses worldwide to adopt sustainable and socially responsible policies, and to report on their implementation. The UN Global Compact is a principle-based framework for businesses, stating ten principles in the areas of human rights, labor, the environment and anti-corruption. Under the Global Compact, companies are brought together with UN agencies, labor groups and civil society. Cities can join the Global Compact through the Cities Programme  Leverancier Six Telekurs",
      "CommentNL": "Het United Nations Global Compact is een initiatief van de Verenigde Naties om bedrijven over de hele wereld aan te moedigen een duurzaam en maatschappelijk verantwoord beleid te voeren en te rapporteren over de implementatie ervan. Het UN Global Compact is een op principes gebaseerd raamwerk voor bedrijven, waarin tien principes zijn vastgelegd op het gebied van mensenrechten, arbeid, milieu en anticorruptie. Onder het Global Compact worden bedrijven samengebracht met VN-agentschappen, vakbonden en het maatschappelijk middenveld. Steden kunnen zich aansluiten bij het Global Compact via het Cities-programma  Leverancier Six Telekurs",
