      "Parent Entity#Code": "",
      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "A secretary, lead party or abactis is the position of the person (male or female) who reports to an organization, such as an association or a foundation. However, a secretary often does more, for example he or she prepares the meetings and monitors the follow-up of the actions.  The secretary within an association has the task of taking minutes during a meeting. Writing letters and invitations is also one of the tasks. Nowadays, the secretary is also often the contact person for incoming e-mail messages for the association and the board, and he or she also takes care of the outgoing e-mails.",
      "CommentNL": "Een secretaris, penvoerder of abactis is de functie van de persoon (man of vrouw) die de verslaglegging doet van een organisatie, zoals van een vereniging of een stichting. Vaak doet een secretaris echter meer, hij of zij bereidt bijvoorbeeld de vergaderingen voor en houdt de opvolging van de acties in de gaten.   De secretaris binnen een vereniging heeft als taak het maken van notulen tijdens een vergadering. Ook het schrijven van brieven en uitnodigingen is een van de taken. Tegenwoordig is de secretaris ook vaak contactpersoon voor ingekomen e-mailberichten voor de vereniging en het bestuur, en verzorgt hij of zij daarnaast de uitgaande e-mails. ",
      "Creator": "unlopo",
