      "Vervallen": "0",
      "Comment": "Structured products are pre-packaged investments that normally include assets linked to interest plus one or more derivatives.  They are generally tied to an index or basket of securities, and are designed to facilitate highly customized risk-return objectives. ",
      "CommentNL": "Een SP is een samengesteld beleggingsproduct, bestaande uit een effecteninstrument en\/of derivaten (bijvoorbeeld opties en swaps).  Structured products worden uitgegeven door The Firm en geadministreerd in het system Structured Productdesk (SPD).  Deze administratie wordt uitgevoerd door de afdeling QED (quantative equity desk) die valt onder Merchant Bank (MB).  De structured products zijn door de bank uitgegeven schuldbewijzen en staan als liability op de balans van The Firm Bankiers (entiteit 001). Dit omvat dus alle uitgegeven SPD’s, ongeacht welk type klant dit product afneemt (intern\/extern\/intercompany). Indien het een interne klant betreft, wordt dit ook in DWH geregistreerd via het effectendepot als instrumentpositie.  In het DWH wordt een structured product vastgelegd in tabel product met producttype ’DEP’ (Deposito). Een Structured product is in het DWH als volgt te herkennen: CD_productvorm_2 = SPD Het gaat hier om een door The Firm uitgegeven structured product.  Indien een klant hier een positie in inneemt zal deze via het effectendepot als instrumentpositie naar voren komen.",
