      "Vervallen": "0",
      "Comment": "All non-settled transactions per Executing Broker. Basically an ’open mail list’. The total list of non-settled transactions is generated by Bankview every day.  Unsettled transactions are transactions where cash is paid without receipt of the corresponding receivable (securities, foreign currencies, gold, or commodities) or, conversely, deliverables were delivered without receipt of the corresponding cash payment expose firms to a risk of loss on the full amount of cash paid or deliverables delivered.  The DWH cannot process the file, cf. other transaction files where delta is used. If the agreed settlement date of a transaction is before the reporting date, this is also referred to as a non-settlement.",
      "CommentNL": "Alle niet gesettelde transacties per Handelsbroker.  In feite een ‘openstaande postenlijst’. Elke dag wordt de totale lijst met niet-gesettelde transacties door Bankview aangemaakt.   Het DWH kan de file niet verwerken cf. overige transactiebestanden waar met delta’s wordt gewerkt. Indien de overeengekomen settlementdatum van een transactie vóór de rapportagedatum ligt, dan spreekt men ook van een non-settlement. ",
