      "Stereotype": "",
      "Vervallen": "0",
      "Comment": "The term derivative refers to a type of financial contract whose value is dependent on an underlying asset, group of assets, or benchmark. A derivative is set between two or more parties that can trade on an exchange or over-the-counter (OTC). These contracts can be used to trade any number of assets and carry their own risks. Prices for derivatives derive from fluctuations in the underlying asset. These financial securities are commonly used to access certain markets and may be traded to hedge against risk. Source: Investopedia ",
      "CommentNL": "De term derivaat verwijst naar een type financieel contract waarvan de waarde afhankelijk is van een onderliggend actief, een groep activa of een benchmark. Een derivaat wordt ingesteld tussen twee of meer partijen die op een beurs of over-the-counter (OTC) kunnen handelen. Deze contracten kunnen worden gebruikt om een willekeurig aantal activa te verhandelen en hun eigen risico’s te dragen. Prijzen voor derivaten zijn afgeleid van schommelingen in de onderliggende waarde. Deze financiële effecten worden vaak gebruikt om toegang te krijgen tot bepaalde markten en kunnen worden verhandeld om risico’s af te dekken. Bron: Investopedia",
